  const [acquisitions, setUserAcquisitions] = useState([])


  useEffect(() => {
      fetch('http://localhost:3000/acquisitions')
          .then(r => r.json())
          .then(data => {
              setStashFavorites(data);
          })
  }, [])

  return (
      <div className="art-page" >
          <UploadArtForm 
            user={user} 
            artworks={artworks} 
            setArtworks={setArtworks}
          />
          <ArtList 
            user={user} 
            artworks={artworks} 
            setArtworks={setArtworks}
            onDeleteArtwork={onDeleteArtwork}
            onUpdateArtwork={onUpdateArtwork}
            />
      </div>
  );
}

